    border: 1px solid #eee;
    background: #fff;
    padding: 9px
}

.no_margin_right {
    margin-right: 0
}

#templatemo_footer .footer_left {
    float: left;
    width: 240px;
}

#templatemo_footer .footer_right {
    float: right;
    width: 700px;
    text-align: right;
}

.no_margin_right {
    margin-right: 0
}

.pagging {
    margin: 0 0 20px;
    padding: 0
}

.pagging ul {
    margin: 0;
    padding: 0;
    list-style: none
}

.pagging ul li {
    margin: 0;
    padding: 0;
    display: inline
}

.pagging ul li a {
    float: left;
    display: block;
    color: #333;
    text-decoration: none;
    margin-right: 5px;
    padding: 5px 10px;
    background: #fff;
    border: 1px solid #eee
}

.pagging ul li a:hover {
    background: #f3b2bd;
    border: 1px solid #eee;
    color: #fff
}

.cleaner {
    clear: both;
    display: block;
}

.h20 {
    height: 20px
}

.h40 {
    height: 40px
}
